open! Core
open Async

let tmp_events_file = "/tmp/events.binio"

let%expect_test "test-events-output" =
  let%bind writer = Writer.open_file tmp_events_file in
  let events_writer =
    Magic_trace_lib.Tracing_tool_output.
      { format = Magic_trace_lib.Tracing_tool_output.Binio
      ; writer
      ; callstack_compression_state = Magic_trace_lib.Callstack_compression.init ()
      }
  in
  let%bind.Deferred () =
    Perf_script.run ~events_writer ~trace_scope:Userspace "hello_world_userspace.perf"
  in
  let%bind.Deferred () = Writer.close writer in
  let%map.Deferred () =
    Reader.with_file tmp_events_file ~f:(fun fd ->
      Pipe.iter
        (Reader.read_all fd (fun fd ->
           Reader.read_bin_prot
             fd
             Magic_trace_lib.Trace_writer.Event_and_callstack.bin_reader_t))
        ~f:(fun event_and_callstack ->
          print_s
            [%sexp
              (event_and_callstack : Magic_trace_lib.Trace_writer.Event_and_callstack.t)];
          return ()))
